import styled from "styled-components";
import { useState, useEffect } from "react";
import axios from "axios";
import { useAppSelector } from "../../hooks";
import Pagination from "../Pagination";
import RenderContent from "./RenderContent";
import BodyTitle from "./BodyTitle";
import { useNavigate } from "react-router-dom";

function WriteFeedBody() {
  return (
    <BodyContainer>
      <BodyWrapper>
        <h2>함께 할 때 더 즐거운 순간</h2>
        <form>
          <div class="form-group pt-5">
            <label for="title1" class="d-block py-2">
              <h6>제목</h6>
            </label>
            <input type="email" class="form-control p-2" id="title1" placeholder="name@example.com" />
          </div>
          <div class="form-group pt-3">
            <label for="tag1" class="d-block py-2">
              <h6>태그</h6>
            </label>
            <select class="form-control" id="exampleFormControlSelect1">
              <option>1</option>
              <option>2</option>
              <option>3</option>
              <option>4</option>
              <option>5</option>
            </select>
          </div>

          <div class="form-group pt-3">
            <label for="exampleFormControlTextarea1">Example textarea</label>
            <textarea class="form-control" id="tag1" rows="3"></textarea>
          </div>
        </form>
      </BodyWrapper>
    </BodyContainer>
  );
}

export default WriteFeedBody;

const BodyContainer = styled.div`
  width: 100%;
`;

const BodyWrapper = styled.div`
  width: 1024px;
  margin: auto;
  padding: 30px 0;
`;

const Label = styled.label``;
